import React, { FC } from "react";
import { useNavigate } from "react-router-dom";
import { IUser } from "../../types/types";
import Subtitle from "../UI/Subtitle/Subtitle";

import "./userList.scss";

interface UserListProps {
  users: IUser[];
  newUser: IUser;
  removeUser: (id: number) => void;
}

const UserList: FC<UserListProps> = ({
  users,
  removeUser,
  newUser,
}: UserListProps) => {
  const navigate = useNavigate();
  return (
    <div className="list">
      <h3>Participation listing (enable only for participants)</h3>
      <div className="list__block">
        <table>
          <tr>
            <th>
              <Subtitle>Name</Subtitle>
            </th>
            <th>
              <Subtitle>Email</Subtitle>
            </th>
            <th>
              <Subtitle>Wallet</Subtitle>
            </th>
          </tr>
          {users.map((user) => (
            <tr
              onClick={() =>
                user.id !== newUser.id && navigate(`/user/${user.id}`)
              }
            >
              <td className="list__item">{user.username}</td>
              <td className="list__item">{user.email}</td>
              <td className="list__item">{user.address}</td>
              {user.id === newUser.id && (
